member.example:
This sample shows how to call GetEmptyAsync.

AzureKeyCredential credential = new AzureKeyCredential("<key>");
PathsClient client = new PathsClient("host", credential);

Response response = await client.GetEmptyAsync("<accountName>");

Console.WriteLine(response.Status);

This sample shows how to call GetEmptyAsync with all parameters.

AzureKeyCredential credential = new AzureKeyCredential("<key>");
PathsClient client = new PathsClient("host", credential);

Response response = await client.GetEmptyAsync("<accountName>");

Console.WriteLine(response.Status);

